    <style>
        @font-face {
            font-family: "Telegraf Ultrabold";
            font-display: swap;
            src: url("font/Telegraf-UltraBold.otf") format("opentype");
        }

        #p1-spb {
            font-family: 'Telegraf Ultrabold',Helvet,serif;
            font-size: calc(3.9rem + .9vw);
            color: white;
            position: absolute;
            padding-left: calc(50vw - (3.9rem + .9vw) * 4);
            padding-top: calc(103px + 8vw - 10vh)
        }

        #p2-spb {
            font-family: 'Telegraf Ultrabold',Helvet,serif;
            font-size: calc(3.9rem + .9vw);
            color: white;
            position: absolute;
            padding-left: calc(50vw - (3.9rem + .9vw) * 4.2);
            padding-top: calc(103px + 12vw - 5vh)
        }

        #h5-spb {
            font-family: 'Telegraf Ultrabold',Helvet,serif;
            font-size: calc(1.5rem + .9vw);
            color: white;
            position: absolute;
            padding-left: calc(50vw - (1.5rem + .9vw) * 11);
            padding-top: calc(103px + 30vw - 5vh);
        }

        @media (max-width: 670px) {
            #h5-spb {
                font-size: calc(1.2rem + .9vw);
                padding-left: calc(50vw - (1.2rem + .9vw) * 11.1);
                padding-top: calc(103px + 30vw - 5vh);
            }
        }

        @media (max-width: 575px) {
            #p1-spb {
                font-size: calc(2rem + .9vw);
                padding-left: calc(50vw - (2rem + .9vw) * 4);
                padding-top: calc(103px + 1vw - 17vh)
            }

            #p2-spb {
                font-size: calc(2rem + .9vw);
                padding-left: calc(50vw - (2rem + .9vw) * 4.2);
                padding-top: calc(103px + 1vw - 12vh)
            }

            #h5-spb {
                text-align: center;
                font-size: calc(1.0rem + .9vw);
                padding-left: calc(50vw - (1.2rem + .9vw) * 9.5);
                padding-top: calc(103px + 10vw - 5vh);
            }
        }
    </style>
